import React, { useState } from "react";
import styles from "./eventCard.module.css";

const EventCard = () => {
  const handleClick = () => {
    const elem = document.getElementsByClassName(eventCardWrapper);
    console.log(elem);
    // elem[0].styles = { height: "200px" };
  };
  return (
    <div className={styles.eventCardWrapper} onClick={handleClick}>
      <div className={styles.topHalf}></div>
      <div className={styles.eventDate}>
        <h1 className={styles.dateHeader}>MONDAY</h1>
        <p className={styles.month}>May</p>
        <p className={styles.day}>10</p>
      </div>
      <div className={styles.eventDetailsWrapper}>
        <h1 className={styles.eventName}>Dinner with friends</h1>
        <p className={styles.eventDetails}>time, sfjlfsl</p>
        <p className={styles.eventDetails}>location, sfjlfsl</p>
        <p className={styles.eventDetails}>notes, sfjlfsl</p>
      </div>
    </div>
  );
};

export default EventCard;
